import React from "react";
import "./App.css";
import Content from "./components/Content";

function App() {
  return (
    <div
      className="App"
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
      }}
    >
      <header className="App-header">
        <p>lbconverter </p>
        <Content />
      </header>
    </div>
  );
}

export default App;
